import React from "react";
import Layout from "../components/Layout";

const blog = () => {
  return (
    <div>
      <p>This is a blog</p>
    </div>
  );
};

export default blog;

const About = () => (
  <Layout>
    <div>
      <h1> Welcome to my About page</h1>
    </div>
  </Layout>
);
